{"metadata":{"language_info":{"mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"3.4.2","file_extension":".r","codemirror_mode":"r"},"kernelspec":{"display_name":"R","language":"R","name":"ir"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Simple Titanic model using only Name scores 82%!\n\nI'm excited to share my Titanic solution and write my first Kaggle notebook. I've had a fun time building dozens of models. Below is my favorite. This simple model only uses one feature more than the gender model but it scores an impressive 82% and outperforms 97% of all 11,300 Kaggle submissions which are all more complicated! Using only passenger names, gender is deduced from title (Mr. Mrs. etc), children are determined from title (Master.), and family groups are identified by duplicate surnames (last names).  \n  \nUPDATE: By combining this model with another that classifies single passengers, 85% was achieved [here][1]. Also 83% and 84% were achieved [here][2].\n\n![model](https://raw.githubusercontent.com/cdeotte/Kaggle_Images/main/2020/tree4.jpeg)\n\nFirst I'll explain how it works. Then, I'll present my model, code, cross validation, and submission results.\n\n![rules](https://raw.githubusercontent.com/cdeotte/Kaggle_Images/main/2020/rules2.jpeg)\n\n## Let's begin with the gender model... \nIf we just predict females survive and males perish, we cross validate at 78.6% and receive a public leaderboard score of 76.6%.  \n \n[1]:https://www.kaggle.com/cdeotte/titanic-wcg-xgboost-0-84688\n[2]:https://www.kaggle.com/cdeotte/titantic-mega-model-0-84210","metadata":{"_uuid":"1363bb9da11eb41865ed33ed5d6876d38bd91051","_cell_guid":"56d7a7ea-e802-4472-bcab-fe80fc830e18"}},{"cell_type":"code","source":"# The gender model achieves a 76.6% leaderboard score\ntest <- read.csv(\"../input/titanic/test.csv\",stringsAsFactors=F)\ntest$Survived[test$Sex=='male'] <- 0\ntest$Survived[test$Sex=='female'] <- 1\nsubmit <- data.frame(PassengerId = test$PassengerId, Survived = test$Survived)\nwrite.csv(submit,\"genderModel.csv\",row.names=F)","metadata":{"_uuid":"1391a64bf2b9813a90e852aba684f6f2d86ef826","_cell_guid":"f1bcfbf6-de73-4e77-ae4c-9c15ae33a0d0","execution":{"iopub.status.busy":"2023-09-09T14:47:25.250017Z","iopub.execute_input":"2023-09-09T14:47:25.252365Z","iopub.status.idle":"2023-09-09T14:47:25.648857Z"},"trusted":true},"execution_count":1,"outputs":[]},{"cell_type":"markdown","source":"To improve upon the gender model, we need to determine which males survive and which females perish. By analyzing the Titanic data, we find that many male survivors are among the youth, namely 52.5% = 21/40 of males under 16 years old survive. And most females who perish are among Pclass==3 passengers, namely 50% = 72/144 of Pclass==3 females perish.","metadata":{"_uuid":"fa64990b6b77bab6e0f899adfe9372ff50fefd92","_cell_guid":"2da6c2e4-4ba4-4bdc-96dd-f49d10b2df3d"}},{"cell_type":"code","source":"train <- read.csv(\"../input/titanic/train.csv\",stringsAsFactors=F)\ntable(train$Survived[train$Sex=='male' & train$Age<16])\ntable(train$Survived[train$Sex=='female' & train$Pclass==3])","metadata":{"_uuid":"91cc81adc0fdd5570008dc826e694768569704d1","_cell_guid":"652bb627-2d8e-4418-a30c-2aa760431768","execution":{"iopub.status.busy":"2023-09-09T14:47:25.651833Z","iopub.execute_input":"2023-09-09T14:47:25.690220Z","iopub.status.idle":"2023-09-09T14:47:25.724366Z"},"trusted":true},"execution_count":2,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n 0  1 \n19 21 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n 0  1 \n72 72 "},"metadata":{}}]},{"cell_type":"markdown","source":"So let's focus on identifying surviving males and perishing females among these 184 passengers. The data indicates that woman and children were prioritized in rescue. Furthermore it appears that woman and children from the same family survived or perished together. There are 142 females and boys in the training dataset who have a relative (indicated by surname) in the training set that is a female or boy. Let's refer to these 142 passengers as members of \"woman-child-groups\".\n\n## Let's engineer a new feature to identify \"woman-child-groups\" and their survival rate.","metadata":{"_uuid":"47badc5d112bde1c4254815d3a7dae40d1364f83","_cell_guid":"f29c2699-ae64-463c-9cc2-0fbbff218a79"}},{"cell_type":"code","source":"# engineer titles in training dataset\ntrain$Title <- substring(train$Name,regexpr(\",\",train$Name)+2,regexpr(\"\\\\.\",train$Name)-1)\ntrain$Title[train$Title %in% c(\"Capt\",\"Don\",\"Major\",\"Col\",\"Rev\",\"Dr\",\"Sir\",\"Mr\",\"Jonkheer\")] <- \"man\"\ntrain$Title[train$Title %in% c(\"Dona\",\"the Countess\",\"Mme\",\"Mlle\",\"Ms\",\"Miss\",\"Lady\",\"Mrs\")] <- \"woman\"\ntrain$Title[train$Title %in% c(\"Master\")] <- \"boy\"\n# engineer \"woman-child-groups\" for training dataset\ntrain$Surname <- substring(train$Name,0,regexpr(\",\",train$Name)-1)\ntrain$Surname[train$Title=='man'] <- 'noGroup'\ntrain$SurnameFreq <- ave(1:891,train$Surname,FUN=length)\ntrain$Surname[train$SurnameFreq<=1] <- 'noGroup'\n# calculate \"woman-child-group\" survival rates\ntrain$SurnameSurvival <- ave(train$Survived,train$Surname)\ntable(train$SurnameSurvival[train$Surname!='noGroup'])","metadata":{"_uuid":"5a403bf98c0562e1dc3a727ffd31c322b179cf27","_cell_guid":"c0204366-ca42-44a5-bb7a-7418820fa14a","scrolled":true,"execution":{"iopub.status.busy":"2023-09-09T14:47:25.727011Z","iopub.execute_input":"2023-09-09T14:47:25.729272Z","iopub.status.idle":"2023-09-09T14:47:25.766279Z"},"trusted":true},"execution_count":3,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n                0 0.142857142857143 0.333333333333333              0.75 \n               50                 7                 3                 8 \n                1 \n               74 "},"metadata":{}}]},{"cell_type":"code","source":"# the following \"woman-child-groups\" all perish\nx=train[train$SurnameSurvival==0,c(\"Surname\")]; unique(x[order(x)])","metadata":{"_uuid":"cd73b78a1750bcdbbb407d081a588111cffeecc1","_cell_guid":"707476ff-c780-40a1-8afc-258a358eed20","execution":{"iopub.status.busy":"2023-09-09T14:47:25.768740Z","iopub.execute_input":"2023-09-09T14:47:25.770859Z","iopub.status.idle":"2023-09-09T14:47:25.818004Z"},"trusted":true},"execution_count":4,"outputs":[{"output_type":"display_data","data":{"text/plain":" [1] \"Barbara\"       \"Boulos\"        \"Bourke\"        \"Ford\"         \n [5] \"Goodwin\"       \"Jussila\"       \"Lefebre\"       \"Palsson\"      \n [9] \"Panula\"        \"Rice\"          \"Sage\"          \"Skoog\"        \n[13] \"Strom\"         \"Van Impe\"      \"Vander Planke\" \"Zabour\"       ","text/latex":"\\begin{enumerate*}\n\\item 'Barbara'\n\\item 'Boulos'\n\\item 'Bourke'\n\\item 'Ford'\n\\item 'Goodwin'\n\\item 'Jussila'\n\\item 'Lefebre'\n\\item 'Palsson'\n\\item 'Panula'\n\\item 'Rice'\n\\item 'Sage'\n\\item 'Skoog'\n\\item 'Strom'\n\\item 'Van Impe'\n\\item 'Vander Planke'\n\\item 'Zabour'\n\\end{enumerate*}\n","text/markdown":"1. 'Barbara'\n2. 'Boulos'\n3. 'Bourke'\n4. 'Ford'\n5. 'Goodwin'\n6. 'Jussila'\n7. 'Lefebre'\n8. 'Palsson'\n9. 'Panula'\n10. 'Rice'\n11. 'Sage'\n12. 'Skoog'\n13. 'Strom'\n14. 'Van Impe'\n15. 'Vander Planke'\n16. 'Zabour'\n\n\n","text/html":"<ol class=list-inline>\n\t<li>'Barbara'</li>\n\t<li>'Boulos'</li>\n\t<li>'Bourke'</li>\n\t<li>'Ford'</li>\n\t<li>'Goodwin'</li>\n\t<li>'Jussila'</li>\n\t<li>'Lefebre'</li>\n\t<li>'Palsson'</li>\n\t<li>'Panula'</li>\n\t<li>'Rice'</li>\n\t<li>'Sage'</li>\n\t<li>'Skoog'</li>\n\t<li>'Strom'</li>\n\t<li>'Van Impe'</li>\n\t<li>'Vander Planke'</li>\n\t<li>'Zabour'</li>\n</ol>\n"},"metadata":{}}]},{"cell_type":"code","source":"# the following \"woman-child-groups\" all survive\nx=train[train$SurnameSurvival==1,c(\"Surname\")]; unique(x[order(x)])","metadata":{"_uuid":"22e95ed9da6b5e60de59c3716df7e49d382d17d4","_cell_guid":"a0bcd12e-57b3-4ebd-bda8-2f1674534