| Allison | boy     | 1       | \n| 499 | Allison | woman   | 0       | \n\n\n","text/html":"<table>\n<thead><tr><th></th><th scope=col>Surname</th><th scope=col>Title</th><th scope=col>Survived</th></tr></thead>\n<tbody>\n\t<tr><th scope=row>298</th><td>Allison</td><td>woman  </td><td>0      </td></tr>\n\t<tr><th scope=row>306</th><td>Allison</td><td>boy    </td><td>1      </td></tr>\n\t<tr><th scope=row>499</th><td>Allison</td><td>woman  </td><td>0      </td></tr>\n</tbody>\n</table>\n"},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"    Surname Title Survived\n26  Asplund woman 1       \n183 Asplund boy   0       \n234 Asplund woman 1       \n262 Asplund boy   1       \n436 Carter  woman 1       \n764 Carter  woman 1       \n803 Carter  boy   1       \n855 Carter  woman 0       ","text/latex":"\\begin{tabular}{r|lll}\n  & Surname & Title & Survived\\\\\n\\hline\n\t26 & Asplund & woman   & 1      \\\\\n\t183 & Asplund & boy     & 0      \\\\\n\t234 & Asplund & woman   & 1      \\\\\n\t262 & Asplund & boy     & 1      \\\\\n\t436 & Carter  & woman   & 1      \\\\\n\t764 & Carter  & woman   & 1      \\\\\n\t803 & Carter  & boy     & 1      \\\\\n\t855 & Carter  & woman   & 0      \\\\\n\\end{tabular}\n","text/markdown":"\n| <!--/--> | Surname | Title | Survived | \n|---|---|---|---|---|---|---|---|\n| 26 | Asplund | woman   | 1       | \n| 183 | Asplund | boy     | 0       | \n| 234 | Asplund | woman   | 1       | \n| 262 | Asplund | boy     | 1       | \n| 436 | Carter  | woman   | 1       | \n| 764 | Carter  | woman   | 1       | \n| 803 | Carter  | boy     | 1       | \n| 855 | Carter  | woman   | 0       | \n\n\n","text/html":"<table>\n<thead><tr><th></th><th scope=col>Surname</th><th scope=col>Title</th><th scope=col>Survived</th></tr></thead>\n<tbody>\n\t<tr><th scope=row>26</th><td>Asplund</td><td>woman  </td><td>1      </td></tr>\n\t<tr><th scope=row>183</th><td>Asplund</td><td>boy    </td><td>0      </td></tr>\n\t<tr><th scope=row>234</th><td>Asplund</td><td>woman  </td><td>1      </td></tr>\n\t<tr><th scope=row>262</th><td>Asplund</td><td>boy    </td><td>1      </td></tr>\n\t<tr><th scope=row>436</th><td>Carter </td><td>woman  </td><td>1      </td></tr>\n\t<tr><th scope=row>764</th><td>Carter </td><td>woman  </td><td>1      </td></tr>\n\t<tr><th scope=row>803</th><td>Carter </td><td>boy    </td><td>1      </td></tr>\n\t<tr><th scope=row>855</th><td>Carter </td><td>woman  </td><td>0      </td></tr>\n</tbody>\n</table>\n"},"metadata":{}}]},{"cell_type":"markdown","source":"The above code shows that 124 out of 142 \"woman-child-group\" passengers were part of \"woman-child-groups\" that either entirely lived or died. And 18 out of the 142 were part of \"woman-child-groups\" with mixed survival. Among these 18 passengers, 14 lived or died according to their \"woman-child-groups'\" average fate and 4 did not. Therefore among all 142 \"woman-child-group\" passengers,  97.2% = 138/142 lived or died according to their \"woman-child-groups'\" average fate. Our new engineered feature is a near perfect predictor! Wow!\n\n## Cross validation\nLet's try to guess what our cross validation accuracy will be when we use this new engineered feature in addition to the gender model before cross validating.","metadata":{"_uuid":"76f90d3cdde899fce5701718f71dca11dd211124","_cell_guid":"331e175c-3216-435d-97bb-395082602c1a"}},{"cell_type":"code","source":"library(ggplot2)","metadata":{"_uuid":"23bf960cfa7cf8e9b410b76e02dfdfb95021b7fa","_cell_guid":"60f6f1a3-2d6d-44dd-a22b-adfea04f6e84","execution":{"iopub.status.busy":"2023-09-09T14:47:25.958354Z","iopub.execute_input":"2023-09-09T14:47:25.959845Z","iopub.status.idle":"2023-09-09T14:47:26.483951Z"},"trusted":true},"execution_count":7,"outputs":[]},{"cell_type":"code","source":"# adjust survival rates for use on training set\ntrain$AdjustedSurvival <- (train$SurnameSurvival * train$SurnameFreq - train$Survived) / (train$SurnameFreq-1)\n# apply gender model plus new predictor to training set\ntrain$predict <- 0\ntrain$predict[train$Title=='woman'] <- 1\ntrain$predict[train$Title=='boy' & train$AdjustedSurvival==1] <- 1\ntrain$predict[train$Title=='woman' & train$AdjustedSurvival==0] <- 0\n# plot how new predictor changes gender model\nggplot(train[train$Title=='woman',]) +\n    geom_jitter(aes(x=Pclass,y=predict,color=factor(Survived))) + \n    labs(title=\"36 female predictions change from gender model on training set\") +\n    labs(x=\"Pclass\",y=\"New Predictor\") +\n    geom_rect(alpha=0,color=\"black\",aes(xmin=2.5,xmax=3.5,ymin=-0.45,ymax=0.45))\ntable(train$Survived[train$Title=='woman' & train$predict==0])","metadata":{"_uuid":"3eed1cdbf466c9c6a3b3f362edf0e67364c33ce8","_cell_guid":"779a1125-76bc-4aa9-88ec-7fbfc166aa8e","execution":{"iopub.status.busy":"2023-09-09T14:47:26.487051Z","iopub.execute_input":"2023-09-09T14:47:26.488623Z","iopub.status.idle":"2023-09-09T14:47:27.967663Z"},"trusted":true},"execution_count":8,"outputs":[{"output_type":"display_data","data":{},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n 0  1 \n35  1 "},"metadata":{}},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wUZfoA8Oedme0tyab3EEJHkCYgIkXsvevZ9ax3Z0HFU+/UE3v52Q+xnace\n9n7KKQiiooIKSIdAet3N9jo7M+/vj03CZls2yaZtnu8ffMjs7sw7s+/MPPvO+z4voZQCQggh\nhBAa/pjBLgBCCCGEEEoODOwQQgghhFIEBnYIIYQQQikCAzuEEEIIoRSBgR1CCCGEUIrAwA4h\nhBBCKEVgYIcQQgghlCIwsEMIIYQQShEY2PWAt3X9ZYumZWoVRVPuGuyyHPL7IzMJIcf+r26w\nC9InT5anE0K+sPgGuyCDZt/rRxFCjnp932AXJMmG5lkz1KRq/e/dfqXGNQ2hwZJigZ205qU7\njzv6iJIcgyo9b+rsBX95/F2nGGVqDdHf+NRfr55WUaxTKAsrDjvtqn/ssfPdrn354rNfX7dF\nyJy44IhR/VB4dMjnh+cQQjLHrxrENaCkwLMGod5djvAihnonhQI76r/jmPIlVz+05oed8uwx\nU0vTDv7y3bO3nVc84dx6Xgx9o+DZdeLYcTc//NLWg60FE8dJrXs/feWeqcVztroCcdfPP7LT\nIlOPrT/w6xsrr+zffUE9FHBtIYQYSv422AVBXeFZg4YhvJ70BR69QccNdgGSpvqjCx5ZW63K\nWPLZ5g8Wj9IBgLt+44Uzlny67/3T/rH11+XTO9/59HHHfFXjPOyK//vyqRvydTKJb3niD3Nv\nf/+3k099uf