nbADggLhiB+BhGMwGEclYn2oLCZs399nWU8sK03KGvhnpHzQvdvYT/c2XTh3MPFQyfFHuon4e\nKoUFAEfBFTsAD8N71IbJz/idTklM2PhtmymzX/SFyyfjJgd/X/B5wtrkk+XGVVsKzqRHq5IT\nAByKTlEUtTMAAACgA3DFDgAAQCModgAAABpBsQMAANAIih0AAIBGUOwAAAA0gmIHAACgERQ7\nAAAAjaDYAQAAaATFDgAAQCModgAAABpBsQMAANAIih0AAIBGUOwAAAA04h9xhoyF3OmRnAAA\nAABJRU5ErkJggg=="},"metadata":{}}]},{"cell_type":"markdown","source":"The two plots above show that our new predictor changes 52 = 36 + 16 predictions from the gender model when applied to the training set. And amazingly, nearly all of the changes are now correct predictions! Wow! Therefore our cross validation accuracy should be 0.786 + (48/891) =  0.840. Let's test it.","metadata":{"_uuid":"9301165a53d5d5c8e601cf7b604c488a69e0817e","_cell_guid":"018a1ef6-d07b-414b-a56a-ea3b16ec651d"}},{"cell_type":"code","source":"# Perform 25 trials of 10-fold cross validation\ntrials = 25; sum = 0\nfor (j in 1:trials){\nx = sample(1:890); s = 0\nfor (i in 0:9){\n    # Engineer \"woman-child-groups\" from training subset\n    train$Surname <- substring(train$Name,0,regexpr(\",\",train$Name)-1)\n    train$Surname[train$Title=='man'] <- 'noGroup'\n    train$SurnameFreq <- ave(1:891,train$Surname,FUN=length)\n    train$Surname[train$SurnameFreq<=1] <- 'noGroup'\n    train$SurnameSurvival <- NA\n    # calculate training subset's surname survival rate\n    train$SurnameSurvival[-x[1:89+i*89]] <- ave(train$Survived[-x[1:89+i*89]],train$Surname[-x[1:89+i*89]])\n    # calculate testing subset's surname survival rate from training set's rate\n    for (k in x[1:89+i*89]) \n    train$SurnameSurvival[k] <- train$SurnameSurvival[which(!is.na(train$SurnameSurvival) & train$Surname==train$Surname[k])[1]]\n    # apply gender model plus new predictor\n    train$predict <- 0\n    train$predict[train$Title=='woman'] <- 1\n    train$predict[train$Title=='boy' & train$SurnameSurvival==1] <- 1\n    train$predict[train$Title=='woman' & train$SurnameSurvival==0] <- 0\n    c = sum(abs(train$predict[x[1:89+i*89]] - train$Survived[x[1:89+i*89]]))\n    s = s + c\n}\ncat( sprintf(\"Trial %d has 10-fold CV accuracy = %f\\n\",j,1-s/890))\nsum = sum + 1-s/890\n}\ncat(sprintf(\"Average 10-fold CV accuracy from %d trials = %f\\n\",trials,sum/trials))","metadata":{"_uuid":"aec0503dab66379d1bbc24404397eb96481675fb","_cell_guid":"027a3933-9de7-4452-90f6-7b25b837465a","execution":{"iopub.status.busy":"2023-09-09T14:47:29.427038Z","iopub.execute_input":"2023-09-09T14:47:29.428558Z","iopub.status.idle":"2023-09-09T14:47:32.127774Z"},"trusted":true},"execution_count":10,"outputs":[{"text":"Trial 1 has 10-fold CV accuracy = 0.837079\nTrial 2 has 10-fold CV accuracy = 0.839326\nTrial 3 has 10-fold CV accuracy = 0.838202\nTrial 4 has 10-fold CV accuracy = 0.835955\nTrial 5 has 10-fold CV accuracy = 0.838202\nTrial 6 has 10-fold CV accuracy = 0.839326\nTrial 7 has 10-fold CV accuracy = 0.834831\nTrial 8 has 10-fold CV accuracy = 0.833708\nTrial 9 has 10-fold CV accuracy = 0.837079\nTrial 10 has 10-fold CV accuracy = 0.838202\nTrial 11 has 10-fold CV accuracy = 0.834831\nTrial 12 has 10-fold CV accuracy = 0.838202\nTrial 13 has 10-fold CV accuracy = 0.840449\nTrial 14 has 10-fold CV accuracy = 0.840449\nTrial 15 has 10-fold CV accuracy = 0.839326\nTrial 16 has 10-fold CV accuracy = 0.835955\nTrial 17 has 10-fold CV accuracy = 0.834831\nTrial 18 has 10-fold CV accuracy = 0.838202\nTrial 19 has 10-fold CV accuracy = 0.834831\nTrial 20 has 10-fold CV accuracy = 0.834831\nTrial 21 has 10-fold CV accuracy = 0.839326\nTrial 22 has 10-fold CV accuracy = 0.840449\nTrial 23 has 10-fold CV accuracy = 0.839326\nTrial 24 has 10-fold CV accuracy = 0.842697\nTrial 25 has 10-fold CV accuracy = 0.841573\nAverage 10-fold CV accuracy from 25 trials = 0.837888\n","name":"stdout","output_type":"stream"}]},{"cell_type":"markdown","source":"Our cross validation accuracy is 83.6% which is near our guess of 84.0%. \n\n## Submission to Kaggle and evaluation\nLet's try to guess what our Kaggle leaderboard score will be using this new engineered feature in addition to the gender model before submission.","metadata":{"_uuid":"b9407ad1f274cb0cb05553e2e6e4c80dfe87ef0c","_cell_guid":"8d024711-6d89-4d60-9630-8cf5b082e49c"}},{"cell_type":"code","source":"# engineer titles in test dataset\ntest$Title <- substring(test$Name,regexpr(\",\",test$Name)+2,regexpr(\"\\\\.\",test$Name)-1)\ntest$Title[test$Title %in% c(\"Capt\",\"Don\",\"Major\",\"Col\",\"Rev\",\"Dr\",\"Sir\",\"Mr\",\"Jonkheer\")] <- \"man\"\ntest$Title[test$Title %in% c(\"Dona\",\"the Countess\",\"Mme\",\"Mlle\",\"Ms\",\"Miss\",\"Lady\",\"Mrs\")] <- \"woman\"\ntest$Title[test$Title %in% c(\"Master\")] <- \"boy\"\n# engineer \"woman-child-groups\" for entire dataset\ntest$Survived <- NA; test$predict <- NA; train$AdjustedSurvival <- NULL\ntrain$Surname <- NULL; train$SurnameFreq <- NULL; train$SurnameSurvival <- NULL\nallData <- rbind(train,test)\nallData$Surname <- substring(allData$Name,0,regexpr(\",\",allData$Name)-1)\nallData$Surname[allData$Title=='man'] <- 'noGroup'\nallData$SurnameFreq <- ave(1:1309,allData$Surname,FUN=length)\nallData$Surname[allData$SurnameFreq<=1] <- 'noGroup'\n# using only \"Name\" scores 0.81818, correcting surname groups with \"Ticket\" scores 0.82296\n# search single woman and children and correct surname groups using Ticket\nfor (i in which(allData$Title!='man' & allData$Surname=='noGroup'))\n    allData$Surname[i] = allData$Surname[allData$Ticket==allData$Ticket[i]][1]\nallData$Surname[is.na(allData$Surname)] <- 'noGroup'\n# calculate \"woman-child-group\" survival rates\nallData$SurnameSurvival <- NA\nallData$SurnameSurvival[1:891] <- ave(allData$Survived[1:891],allData$Surname[1:891])\nfor (i in 892:1309) allData$SurnameSurvival[i] <- allData$SurnameSurvival[which(allData$Surname==allData$Surname[i])[1]]\n# apply gender model plus new predictor to test dataset\nallData$predict <- 0\nallData$predict[allData$Title=='woman'] <- 1\nallData$predict[allData$Title=='boy' & allData$SurnameSurvival==1] <- 1\nallData$predict[allData$Title=='woman' & allData$SurnameSurvival==0] <- 0\n# plot predictions\nggplot(allData[892:1309,]) +\n    geom_jitter(aes(x=Title,y=predict)) +\n    labs(title=\"18 predictions change from gender model on test set\") +\n    labs(x=\"Title\",y=\"Prediction\") +\n    geom_rect(alpha=0,color=\"black\",aes(xmin=0.5,xmax=1.5,ymin=0.55,ymax=1.45)) +\n    geom_rect(alpha=0,color=\"black\",aes(xmin=2.5,xmax=3.5,ymin=-0.45,ymax=0.45))\n","metadata":{"_uuid":"9766fd8414cc3526678b5432cb8e8e0e243b71ce","_cell_guid":"97ed249d-8935-493c-85ae-d018d9c59b19","execution":{"iopub.status.busy":"2023-09-09T14:47:32.130242Z","iopub.execute_input":"2023-09-09T14:47:32.132162Z","iopub.status.idle":"2023-09-09T14:47:32.820138Z"},"trusted":true},"execution_count":11,"outputs":[{"output_type":"display_data","data":{},"metadata":{}},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd1wUx/sH8Nm9Ozh6UUFFmkgTGwj2AjbQYIn9a0NjL9HE3mKKXWOCvWvsGmOL\nYolRLNijqNh7B0V657jd3x+r9zuvccDdHhyf9x++YHZ39tnC3ePszgzFsiwBAAAAgLKPNnQA\nAAAAAKAbSOwAAAAAjAQSOwAAAAAjgcQOAAAAwEggsQMAAAAwEkjsAAAAAIwEEjsAAAAAI4HE\nDgAAAMBIILErG37zsKMo6mhyrqEDMZhHW5pTFNV8yyNDB6JjOR/ODGwVUNHS1LnuDEPHUnoZ\n6/1fvOO6vTCIoqh2J17rKSoAKNOMNrHb1LiKldO36pY+OvVHz/bBXs6VxDaOdRsGj16wI6Wg\nLM3AccTfkaKoir67DFgD6MSc1t23RMcWVPQLbljd0LEAAECZZ5yJXV5KzIT/Pqhb+u/M1t5t\nBu09fjZDWLG2m93L2POrpvVz8+oan8/wGSSfJJmxFEXZuP5g6EDgS2z+wrvJInPvN0+vb1s3\n2NDRAGhFf58nfH5S4VMRjJXQ0AHoGCPJvHV6/+wxY1MLGEtVK6Q9XhQ2L1oodtly6lyfJq6E\nkPy0R7M6tlx4/mDLwccfbevAc8DFEzB/7a7UXFPrxgasAUqOlWZLWdbUvJalgDJ0LAAAYAyM\nKrHb2abWN9H38hhND1Xv/faHlGX9Jx3gsjpCiImN108H1i2s2OnloVmE6DKxy3pz5/yNF76h\n7V1NBTqslhBSNaxLb0PXAPqmv/unHMLJBIBywqgexVZp0LrfoG8GDx4c0belunUYCUMIEdma\nyBfSIjtCCMvka6j8B1cbkVl1Qkj0up9C6tSwNhO7+TXoOWjsyUdp8qtx7/iPfpL637rhVdzq\ntu/ccW9ijmzp87Pbh/TpEuDjIjazrVErcORPa55kFyjsSJr3ds3M0aHN/Cuam1ao4v71kOlx\nKXkK66joScBK/tnwc8+vgqs7Wlk7uAS1+GrFwevckl2+FU2sAggh6a/mUBRVwXuz6hqI9